import React, {Component} from 'react';
import {Todo} from './Todo'

export class TodoList extends Component {

    constructor(props) {
        super(props);
    }   

    render() {
        return ( 
            <div>
                <ol>
                   <li>{this.props.text}</li> 
                </ol>
            </div>
        );
    }
}
export default TodoList;
